To encode and decode a long string in JavaScript, you can use the `btoa()` and `atob()` functions, respectively. These functions are part of the `Buffer` object, which is used to handle binary data.

Here's an example of how to encode a string:

```javascript
let longString = "This is a long string that I want to encode.";
let encodedString = btoa(longString);
console.log(encodedString);
```

And here's how to decode the encoded string:

```javascript
let decodedString = atob(encodedString);
console.log(decodedString);
```

Please note that the `btoa()` function encodes the string in base64, which means that it will be converted into a string of characters that can be easily shared via a URL. The `atob()` function decodes the base64 string back into the original string.

Also, keep in mind that the `btoa()` function will not work in Internet Explorer 8 and earlier versions, so you may need to use a different method to encode and decode the string if you need to support those browsers.
